import React from "react";
import { logout, isLogin } from "../utils";
import { Link } from "react-router-dom";
import {
  Row,
  Container,
  Button,
  FormGroup,
  Input,
  Col,
  Card,
  CardBody,
  CardTitle,
  CardSubtitle
} from "reactstrap";
function Home() {

    handleLogout = () => {
      logout();
      this.setState({
        isLogin: false
      });
    };
    
    return(
        <div>
            <h1>Welcome User</h1>
        </div>
    )
} export default Home
